    """Reward function for CartPole-v1

    Args:
        observations (np.ndarray): observation on the current state
        is_success (bool): True if the goal is achieved, False otherwise
        is_failure (bool): True if the episode ends unsuccessfully, False otherwise

    Returns:
        float: The reward for the current step
    """
    if is_success:
        return 10.0
    elif is_failure:
        return -10.0
    else:
        cart_position, cart_velocity, pole_angle, pole_angular_velocity = observations
        return np.cos(pole_angle) * (1 - abs(cart_position))

def reward_func(observations:np.ndarray, is_success:bool, is_failure:bool) -> float:
    """Reward function for CartPole-v1

    Args:
        observations (np.ndarray): observation on the current state
        is_success (bool): True if the goal is achieved, False otherwise
        is_failure (bool): True if the episode ends unsuccessfully, False otherwise

    Returns:
        float: The reward for the current step
    """
    if is_success:
        return 1.0
    elif is_failure:
        return -1.0
    else:
        x, _, theta, _ = observations
        return np.exp(-np.abs(x) - 2 * np.abs(theta))

def reward_func(observations:np.ndarray, is_success:bool, is_failure:bool) -> float:    
    x, x_dot, theta, theta_dot = observations

    if is_success:
        return 10.0
    elif is_failure:
        return -10.0
    else:
        # Reward based on how close to vertical the pole is and how stable it is
        proximity_to_vertical = np.cos(theta)
        stability_factor = np.exp(-abs(theta_dot))

        reward = proximity_to_vertical * stability_factor

        return reward

