def reward_func(observations:np.ndarray, is_success:bool, is_failure:bool) -> float:
    pole_angle = observations[2]
    cart_position = observations[0]

    if is_success:
        return 1.0

    if is_failure:
        return -1.0

    angle_penalty = np.abs(pole_angle) / (np.pi/2)
    position_penalty = np.abs(cart_position) / 4.8
    velocity_penalty = np.abs(observations[3]) / 5.0

    reward = 1.0 - (angle_penalty + position_penalty + velocity_penalty)

    return max(reward, -1.0)

